import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import CusNavbar from './components/Navbar';

function App() {


  return (
    <Router>
      <CusNavbar />
      <Switch>
        <Route path="/" />
        <Route path="/products"  />
        <Route path="/cart"/>
        <Route path="/checkout"/>
        <Route path="/order-history"  />
        {/* Add more routes as needed */}
      </Switch>
    </Router>
  );
}

export default App;
